import React from 'react'
import { Container, Row, Col } from 'react-bootstrap'
const layoutStyle = {
    backgroundColor: '#BAF2D7',
    height: "100px"
};
export default function footer() {
    return (
        <div>
            <Container>
                <Row>
                    <Col>
                        <Navbar style={{ height: "120px", display: "flex", alignItems: "flex-end" }} collapseOnSelect expand="lg">
                            <Navbar.Brand style={{ fontSize: "25px" }} href="/">Business</Navbar.Brand>
                            <Navbar.Brand style={{ fontSize: "25px" }} href="/techPage">Technology</Navbar.Brand>
                        </Navbar>
                    </Col>
                </Row>
            </Container>
        </div>
    )
}
